import React, { useState } from 'react'
import { useParams } from 'react-router-dom'
import userService from '../service.js/userService';

const MyBookings = () => {

 const {id} = useParams();
 const [trip, setTrip] = useState([])

 const getTripsCompleted=()=>{
  userService.getTripsCompleted(id).then((response)=>{
   setTrip(response.data);
  }).catch(error=>{
   console.log(error);
  })
 }

 const getTripsOnLive=()=>{
  userService.getTripOnLive(id).then((response)=>{
   setTrip(response.data);
  }).catch(error=>{
   console.log(error);
  })
 }

 const getUpcomingTrips=()=>{
  userService.getUpcomingTrips(id).then((response)=>{
   setTrip(response.data);
  }).catch(error=>{
   console.log(error);
  })
 }



  return (
    <div>
      <div className='container'>
       <h2 className='text-center text-warning'>My Bookings</h2>
       <div className='side-by-side'>
        <div className='p-5'></div>
        <div>
         <button className='btn btn-warning' onClick={()=>getTripsCompleted()}>Trip Completed</button>
        </div>
        <div className='p-5'></div>
        
        <div>
         <button className='btn btn-warning' onClick={()=>getTripsOnLive()}>Trip Completed</button>
        </div>
        <div>
         <button className='btn btn-warning' onClick={()=>getUpcomingTrips()}>Trip Completed</button>
        </div>
       </div>
      </div>
    </div>
  )
}

export default MyBookings
